    def predict(self, film_values):

        print(film_values)
        imdb = float(film_values["imdb"])
        ageRating = int(film_values["age"])
        industry = int(film_values["ind"])
        releaseDate = datetime.strptime(film_values["date"], '%Y-%m-%d').year

        directors = film_values["dir"].lower().split(',')
        d = [0,0,0]
        i = 0
        while i < len(directors):
            d[i] = directors[i]
            i+=1

        writers = film_values["wri"].lower().split(',')
        w = [0,0,0,0,0,0]
        i = 0
        while i < len(writers):
            w[i] = writers[i]
            i+=1

        languages = film_values["lan"].lower().split(',')
        sum = []
        for l in languages:
            sum.append(self.language[l.strip()])

        i = 1
        lang = sum[0]
        while i < len(sum):
            lang = lang * sum[i]
            i+=1
            
        runtime = int(film_values["dur"])

